CREATE TABLE transactions(
   id         INTEGER  NOT NULL PRIMARY KEY
  ,product_id INTEGER  NOT NULL
  ,farmer_id  INTEGER  NOT NULL
  ,buyer_id   INTEGER  NOT NULL
  ,created_at DATE  NOT NULL
  ,price      INTEGER  NOT NULL
  ,quantity   NUMERIC(6,2) NOT NULL,
  INDEX `fk_transactions_1` (`product_id` ASC) VISIBLE,
  CONSTRAINT `fk_transactions_1`
    FOREIGN KEY (`product_id`)
    REFERENCES `products` (`id`)
    ON DELETE CASCADE
    ON UPDATE NO ACTION,
    INDEX `fk_transactions_2` (`farmer_id` ASC) VISIBLE,
  CONSTRAINT `fk_transactions_2`
    FOREIGN KEY (`farmer_id`)
    REFERENCES `farmers` (`id`)
    ON DELETE CASCADE
    ON UPDATE NO ACTION,
    INDEX `fk_transactions_3` (`buyer_id` ASC) VISIBLE,
  CONSTRAINT `fk_transactions_3`
    FOREIGN KEY (`buyer_id`)
    REFERENCES `buyers` (`id`)
    ON DELETE CASCADE
    ON UPDATE NO ACTION
);
